function creaPdf() {
    var doc = new jsPDF();
    doc.setFont("Verdana");

    doc.text(75, 20, "Creare un pdf con javascript");
    doc.text(20, 30, "Questo file PDF");

    doc.addPage();
    doc.text(20, 20, "Prima Pagina:");
    var nome = document.getElementById("nome").value;
    doc.text(20, 40, "Il nome \u00E8: " + nome);
    var cognome = document.getElementById("cognome").value;
    doc.text(20, 60, "Il cognome \u00E8: " + cognome);
    var numero = document.getElementById("numero").value;
    doc.text(20, 80, "Il numero \u00E8: " + numero);
    var email = document.getElementById("email").value;
    doc.text(20, 100, "La email \u00E8: " + email);
    var messaggio = document.getElementById("messaggio").value;
    doc.text(20, 120, "Il messaggio \u00E8: " + messaggio);

    doc.addPage();

    var img = "data:image/jpeg;base64,";
	doc.addImage(img, "JPEG", 15, 40, 180, 160);
    doc.text(20, 280, "Fine documento");

    doc.save("PDFdiProva.pdf");
}